class CustomStack:

    def __init__(self, maxSize: int):
        self.stack = []
        self.size = 0
        self.maxSize = maxSize
        self.add = []
        

    def push(self, x: int) -> None:
        if self.size < self.maxSize:
            self.stack.append(x)
            self.size += 1
            self.add.append(0)
        

    def pop(self) -> int:
        if self.size > 0:
            self.size -= 1
            inc = self.add.pop()
            if self.size > 0:
                self.add[-1] += inc
            val = self.stack.pop()
            return val+inc
        return -1
        
        

    def increment(self, k: int, val: int) -> None:
        n = min(k, self.size)
        if n >= 1:
            self.add[n-1] += val
```

time: push O(1), pop O(1), increment O(1), space O(N)

