### 思路
对数组进行两次遍历。
第一次从左向右使用一个指针来记录最靠近当前字母左边的c的位置，并记录下距离。
第二次从右向左同样使用指针来计算当前字母与最靠近的右边的c的距离并与第一次遍历的结果进行对比取最小值。

### 代码
```java
class Solution {
    public int[] shortestToChar(String s, char c) {
        final int n = s.length();
        int pos = -n;
        int[] res = new int[n];

        for(int i = 0; i < n; i++) {
            if(s.charAt(i) == c) {
                pos = i;
            }
            res[i] = i - pos;
        }

        for(int i = pos; i >= 0; i--) {
            if(s.charAt(i) == c) {
                pos = i;
            }
            res[i] = Math.min(res[i], pos - i);
        }

        return res;
    }
}


```

**复杂度分析**
- 时间复杂度：O(2N)，两次遍历
- 空间复杂度：O(1)

### 思路
额外创建一个数组int[] inc来记录对应的index上增加的值，index = Math.min(k, stack.size()) - 1。 当pop操作时，将pop出的值与inc[i]的值相加返回，inc[i-1]的值要加上inc[i]的值，之后inc[i]变为0.

### 代码
class CustomStack {
    int n;
    int[] inc;
    Stack<Integer> stack;

    public CustomStack(int maxSize) {
        n = maxSize;
        inc = new int[n];
        stack = new Stack<>();
    }

    public void push(int x) {
        if(stack.size() < n) {
            stack.push(x);
        }
    }

    public int pop() {
        int i = stack.size() - 1;
        if(i < 0) {
            return -1;
        }
        if(i > 0) {
            inc[i - 1] += inc[i];
        }
        int res = stack.pop() + inc[i];
        inc[i] = 0;
        return res;
    }

    public void increment(int k, int val) {
        int i = Math.min(k, stack.size()) - 1;
        if(i >= 0) {
            inc[i] += val;
        }
    }
}

```

**复杂度分析**
- 时间复杂度：所有操作均为O(1)
- 空间复杂度：开了新的数组所以为O(N)

