### 思路
采用双指针的方式进行求解，分别从两个方向进行遍历，头部 -> 尾部，尾部 -> 头部，通过取最小值的方式将之前保存的距离进行覆盖

### 代码
```var shortestToChar = function (s, c) {
  let i = 0;
  let k = s.length - 1;
  let iKey = -1;
  let kKey = -1;
  let arr = [];
  while (i < s.length) {
    if (s[i] !== c) {
      arr[i] = Math.min(iKey >= 0 ? i - iKey : 10000, arr[i] || 10000);
    } else {
      iKey = i;
      arr[i] = 0;
    }
    if (s[k] !== c) {
      arr[k] = Math.min(kKey >= 0 ? kKey - k : 10000, arr[k] || 10000);
    } else {
      kKey = k;
      arr[k] = 0;
    }
    i++;
    k--;
  }
  return arr;
};
```
