class CustomStack {
  constructor(maxSize) {
    this.maxSize = maxSize;
  }
  /**
   * 最大值
   * @param {number} maxSize
   */
  maxSize = 0;
  /**
   * 栈空间
   */
  stack = [];
  /**
   * 初始化
   * @param {number} maxSize
   */
  /**
   * 入栈
   * @param {number} maxSize
   * @return {void}
   */
  push(x) {
    if (this.stack.length < this.maxSize) this.stack.push(x);
    return null;
  }
  /**
   * 出栈
   * @param {number} x
   * @return {number}
   */
  pop(x) {
    if (this.stack.length > 0) return this.stack.pop();
    return -1;
  }
  /**
   * 增加值操作
   * @param {number} k
   * @param {number} val
   */
  increment(k, val) {
    for (let i = 0; i < k && i < this.stack.length; i++) {
      this.stack[i] += val;
    }
    return null;
  }
