### 思路

这个题目可以理解为大数相加的变形。

- step1: 去 num 和 k 的最大长度
- step2: 对 num 和 k(k 需要转换为数组) 进行前置补 0
- step3: 逆序遍历按位相加，同时需要考虑是否有进位(大于 9，即有进位)

### 代码

```js
/**
 * @param {number[]} num
 * @param {number} k
 * @return {number[]}
 */
var addToArrayForm = function (num, k) {
  if (num === 0) return k;

  // k 计算 k 的长度
  var kLen = 0;
  var secondNum = [];
  var firstNum = [];
  var kLen = String(k).length;
  // 最大长度
  var maxLen = num.length > kLen ? num.length : kLen;

  // 补0
  for (var j = maxLen - 1; j >= 0; j--) {
    if (j > num.length - 1) {
      firstNum.push(0);
    } else {
      firstNum.push(num.shift());
    }
  }

  for (var i = maxLen - 1; i >= 0; i--) {
    if (i > kLen.length - 1) {
      secondNum.push(0);
    } else {
      secondNum.unshift(k % 10);
      k = (k - (k % 10)) / 10;
    }
  }

  // 遍历相加
  var bit = 0;
  for (var k = maxLen - 1; k >= 0; k--) {
    var sum = firstNum[k] + secondNum[k] + bit;
    if (sum >= 10) {
      secondNum[k] = sum % 10;
      bit = (sum - (sum % 10)) / 10;
    } else {
      bit = 0;
      secondNum[k] = sum;
    }
  }

  if (bit > 0) {
    return [bit, ...secondNum];
  }

  return secondNum;
};
```

**复杂度分析**

对数据进补 0 和按位相加，进行了遍历，时间复杂度为 O(N)；

声明了 firstNum 和 secondNum 临时变量存放数据，空间负责度为 O(N)

- 时间复杂度：O(N)
- 空间复杂度：O(N)

### 思路

- 基本思想：从题目里可以得知，会用到回溯思想：字符 C 出现不止一次，当第 N + 1 次 (N >=1) 出现时，需要进行判断第 N + 1 次出现的位置和 第 N 次出现的位置之间的元素距离进行比对，取最小的那个距离。
- 数据结构
  - 栈: 结果存到到堆栈里，因为回溯会用到数据结果栈
  - 队列: 从栈顶弹窗的元素，再次进栈需要用队列，先出栈的元素先进栈

### 代码

```js
/**
 * @param {string} s
 * @param {character} c
 * @return {number[]}
 */
var shortestToChar = function (s, c) {
  // 存放结果
  var res = [];
  var targetPos = -1;

  // step1: 先将 s 转换成数组
  var sArr = s.split("");

  // step2: 遍历 sArr
  for (var i = 0; i < sArr.length; i++) {
    if (sArr[i] !== c) {
      // 长度默认设置为 1
      res.push(
        targetPos === -1
          ? 10000
          : Math.abs(i - (targetPos === -1 ? 0 : targetPos))
      );
      continue;
    }
    console.log("step1: res:", res, targetPos, i);

    if (sArr[i] === c) {
      var tempArr = [];
      // 先出栈到距离为0的元素
      while (res.length > 0 && res[res.length - 1] !== 0) {
        tempArr.unshift(res.pop());
      }
      console.log("step2: tempArr:", tempArr);

      // 再次进栈校验距离
      while (tempArr.length > 0) {
        var len = tempArr.length;
        const head = tempArr.shift();
        console.log("head:", head);
        if (head > len) {
          res.push(len);
        } else {
          res.push(head);
        }
      }
      res.push(0);
      console.log("step3: res:", res, targetPos, i);
      targetPos = i;
      continue;
    }
  }

  return res;
};
```

**复杂度分析**

空间复杂度取决于临时队列的长度，即 O(N)

时间复杂度取决于回溯元素的长度，即 O(N)，遍历的时间复杂度也是 O(N)，这 2 个是叠加关系，及时间复杂度是 O(N)

- 时间复杂度：O(N)
- 空间复杂度：O(N)

### 思路

- 栈的结构特性: 先进先出，只能从一端进栈和出栈
- 自定义栈类的要求:
  - 限制了栈的长度，栈满了就不允许进栈
  - 新增了 inc 操作

可以借助数组数据结构模拟栈，进栈调用 `push` API，出栈调用 `pop` API。进栈的时候判断数组长度是不是大于 maxSize， 出栈的时候判断数组长度是否为 0

### 代码

```js
/**
 * @param {number} maxSize
 */
var CustomStack = function (maxSize) {
  this.maxSize = maxSize;
  this.stack = [];
};

/**
 * @param {number} x
 * @return {void}
 */
CustomStack.prototype.push = function (x) {
  if (this.stack.length < this.maxSize) {
    this.stack.push(x);
  }
  return null;
};

/**
 * @return {number}
 */
CustomStack.prototype.pop = function () {
  if (this.stack.length > 0) {
    return this.stack.pop();
  }
  return -1;
