### 思路

- 可以理解为括号匹配的升级版
- 遍历字符串，借助数组存放过程态
- 逆向遍历字符串，寻找 `[ ]` 之间包裹的字符串
- 继续往前寻找数字，遇到字符结束

### 代码

```js
/**
 * @param {string} s
 * @return {string}
 */
var decodeString = function (s) {
  var num = [];
  var stack = [];
  var len = String(s).length;
  // 标识是否遇到
  var flag = 0;

  for (var p = len - 1; p >= 0; p--) {
    var ch = s.charAt(p);
    // 非数字进入
    if (isNaN(Number(ch))) {
      if (flag === 0) {
        stack.push(ch);
        continue;
      }

      // 数字
      var k = Number(num.join(""));
      var stop = false;
      var sub = [];
      // console.log("k:", stack, k);

      while (!stop) {
        var t = stack.pop();
        if (t === "[") {
          continue;
        }
        if (t === "]") {
          // 重复 k 次
          for (var n = 0; n < k; n++) {
            stack.push(sub.join(""));
          }
          stop = true;
          continue;
        } else {
          sub.push(t);
        }
      }
      stack.push(ch);
      // console.log("step:", stack, p);
      flag = 0;
      num = [];
      sub = [];
      continue;
    } else {
      num.unshift(ch);
      flag = 1;
    }
  }

  // console.log("step:", stack, num);
  if (num.length > 0) {
    var k = Number(num.join(""));
    var stop = false;
    var sub = [];
    while (!stop) {
      var t = stack.pop();
      if (t === "[") {
        continue;
      }
      if (t === "]") {
        // 重复 k 次
        // console.log("sub:", sub, k);
        for (var n = 0; n < k; n++) {
          stack.push(sub.join(""));
        }
        stop = true;
        break;
      }
      sub.push(t);
    }
  }

  return stack.reverse().join("");
};
