## 思路
这类字符串匹配括号或者特殊符号的场景，我一般首先想到的要不就是用字符串替换法（正则），要不就用栈来操作。本题题解就用栈的形式进行操作：
针对字符串做一次遍历，遍历过程中要处理几个条件：
统一点，除了']'和数字类型需要单独处理外，将其余的char统统推入栈中；
1. '!isNaN(char)'
用于计算重复次数，之前以为数字只会是1位，导致用例 100[leetcode] 没过。
在一次遍历中只能获取一位数字，那么在遇到'['之前数字是要累加的，算法为：```times = times * 10 + parseInt(item);```
2. '[' 
将之前算好的次数推入栈中。并将全局变量times重置为0；
3. ']'
* 这里是重点 *，首先这里是要计算需要重复字符串的，循环从已有的stack中pop元素，当遇到'['需要停止，并再次pop出来之前计算的重复次数times，然后将``` += ```后的repeatStr推入栈中
4. 其他
当前char 统统推入栈中

通过这次遍历，那么整个栈都只剩下``` string[] ``` 了。然后将字符串数组拼接起来，就是最终的答案了。

## 解法
```javascript
var decodeString = function (s) {
  const stack = [];
  let times = 0;
  // 考虑栈的操作
  for (const item of s) {
    if (item === "[") {
      stack.push(times);
      stack.push(item);
      times = 0;
    } else if (item === "]") {
      let repeatStr = "";
      while (1) {
        const stackPopItem = stack.pop();
        if (stackPopItem === "[") {
          const repeatTimes = stack.pop();
          repeatStr = repeatStr.repeat(repeatTimes);
          break;
        } else {
          repeatStr = stackPopItem + repeatStr;
        }
      }
      stack.push(repeatStr);
    } else if (!isNaN(item)) {
      times = times * 10 + parseInt(item);
    } else {
      stack.push(item);
    }
  }

  console.log("res", stack);
  return stack.join("");
};
```

