class Solution {
public List<Integer> addToArrayForm(int[] num, int k) {
        List<Integer> result = new ArrayList<>();
        for (int i = num.length - 1; i >= 0; i--) {
            // 逐位相加
            int sum = num[i] + k % 10;
            k /= 10;
            // 进位
            if (sum >= 10) {
                k++;
                sum -= 10;
            }
            result.add(0, sum); 
        }

        for (; k > 0; k/= 10) {
            result.add(0, k % 10);
        }
        return result;
    }
}
