        // 到右侧 同字符距离 n
        while( s[i]!='\0'){
            if(s[i]==c){
                temp[i]=0;
                for(int j = b; j<i; j++){
                    cur = i-j;
                    if(temp[j] > cur){temp[j] = cur;}          
