    int pop() {
        int cur;
        if(top==-1) return -1; //空了
        cur = stk[top] + add[top];
        if(top != 0) add[top-1] += add[top]; // 错误 add[top-1] = add[top]
        add[top] = 0; //跟着元素出栈清零
        --top;
        return cur; 
    }

    void increment(int k, int val) {
        int rag;
        rag = min(k, top+1);
        // 优化器前
