根据题意 这道题很像是找e为终点的最短路径，直接套用BFS来求解
```
 private int[] bfs(String s,char c){
        int n = s.length();
        int res[] = new int[n];
        Arrays.fill(res,-1);
        LinkedList<Integer> queue = new LinkedList<>();
        for(int i = 0;i<n;i++){
            if(s.charAt(i) == c){
                queue.offer(i);
                res[i] =0;
            }
        }
        int []dir = new int[]{-1,1};
        while(!queue.isEmpty()){
            int index = queue.poll();
            for(int d:dir){
                int next = index+d;
                if(next >=0 && next<n && res[next] ==-1){
                    res[next] = res[index] +1;
                    queue.offer(next);
                }
            }
        }
        return res;
