class Solution {
    public List<Integer> addToArrayForm(int[] num, int k) {
        int n = num.length;
        int carry = 0;
        LinkedList<Integer> linkedList = new LinkedList<>();
        for (int i = n - 1; i >= 0; i--) {
            int val = num[i];
            int newVal = val + k % 10 + carry;
            linkedList.addFirst(newVal % 10);
            // num[i] = newVal % 10;
            k /= 10;
            carry = newVal / 10;
        }
        if(carry !=0 || k !=0){
            int val = carry+k;
            while(val !=0){
                linkedList.addFirst(val%10);
                val = val/10;
            }
        }
        return linkedList;
    }
}
